import React from "react";

import logosize from './images/logosize.svg';
import About from "./About";
import Home from "./Home";

import { useHistory } from "react-router-dom";

import {
  BrowserRouter as Router,
  Route,
  Switch,
  Link,
  withRouter,
  Redirect
} from "react-router-dom";


import {
  BoxHeader,
  ContainerHeader,
  RowHeader,
  ColumnHeader,
  FooterLinkHeader,
  HeadingHeader,
  ImgagingHeader,
  StartButtonHeader,
} from "./HeaderStyles";

function Navigation(props) {
  return (
    <Router>

       <Route exact path="/About" component={About} />
       <Route exact path="/" component={Home} />

      <BoxHeader>
        <div><ImgagingHeader src={logosize} alt="logo" /></div>
        <ContainerHeader>
        <RowHeader>
          <ColumnHeader>
            <HeadingHeader href="/">Home</HeadingHeader>
          </ColumnHeader>
          <ColumnHeader>
            <HeadingHeader href="/About">About Us</HeadingHeader>
          </ColumnHeader>
          <ColumnHeader>
            <HeadingHeader href="/About">Services</HeadingHeader>
          </ColumnHeader>
          <ColumnHeader>
            <HeadingHeader>Contact Us</HeadingHeader>
          </ColumnHeader>
          <ColumnHeader>
            <HeadingHeader>Social Media</HeadingHeader>
         </ColumnHeader>
          <ColumnHeader><StartButtonHeader>LET's GET STARTED</StartButtonHeader></ColumnHeader>
        </RowHeader>
      </ContainerHeader>

    </BoxHeader>
    </Router>  
  );
}

export default withRouter(Navigation);
